import React, { useState } from 'react';
import styled from "styled-components";
import { Navigate } from 'react-router-dom';

const Container = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    min-height: 100vh;
    padding: 20px;
    background-color: #D3E8F7;
    box-sizing: border-box;
`;

const Title = styled.div`
  font-size: 25px;
  font-family: "Pretendard-ExtraBold";
  color: #252A2F;
`;

const ImgPicker = styled.div`
  display: flex;
  position: relative;
  flex: 1;
  margin: 5px;
`;

const ImgContainer = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  margin-top: 5%;
  gap: 5%;
  width: 100%;
  flex-wrap: wrap;
`;

const Img = styled.img`
  width: 100%;
  border-radius: 5%;
  position: relative;
  box-shadow: 0 0 2px rgba(0, 0, 0, 0.1);
`;

const RankBadge = styled.div`
  position: absolute;
  top: 10px;
  left: 10px;
  background-color: rgba(255, 255, 255, 0.7);
  color: black;
  border-radius: 50%;
  width: 25px;
  height: 25px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-weight: bold;
`;

const TasteSurvey = () => {

  return (
    <Container>
      <Title>어떤 여행을 주로 다니셨나요?</Title>
    </Container>
  );
};

export default TasteSurvey;
